import React from 'react'
import OurContactDetails from './OurContactDetails'
import UserContactForm from './UserContactForm'

function Contact() {
  return (
    <div>
        <OurContactDetails/>
        <br/>
    <UserContactForm/>
    </div>
  )
}

export default Contact
